RULES. I’ve described most deal related issues in the below and I will not reply to questions already covered. I know you don’t owe me anything but if you don’t respect me and my request I won’t respect you. No exceptions. Thank you.
OFFERS.
1. Offers are welcome only when you are PayPal ready and sure about the deal:
1.1. Ask any questions BEFORE sending offers. If you request additional info after the offer is accepted you’ll be blocked immediately;
1.2. Please complete the deal over 2-3 days after the offer is accepted;
1.3. If something changes and the deal cannot be done – please spend 2 minutes to briefly explain the situation. Flakers are blocked;
1.4. Please do NOT send offers “to test waters”. I don’t mind discussing the price in the messages – but please don’t write “I’ll buy it immediately if…” if you don’t actually plan to buy it;
1.5. I will not reply to offers posted in comments;
1.6. I do not re-negotiate accepted offers;
2. Be reasonable when offering:
2.1. There is a 60% threshold on grailed but it doesn’t mean I always consider offers in that range;
2.2. Everyone wants the best price but please avoid ridiculously low offers;
3. If “make an offer” button is turned off I do NOT consider offers:
3.1. I might discuss a minor discount subject to larger deal or something like that;
3.2. I will put “final price” in the heading to indicate that the final price is reached. I used to drop prices even after this point before but I will no longer practice it;
3.3. If you’re not happy with the shipping price please don’t buy. I always consider prices all in – please do the same;
TRADES.
1. Trades are highly unlikely but possible if:
1.1. They are in my favor;
1.2. They will help me reducing the collection (i.e. I’m happy to trade a bunch of stuff for something expensive, not vice versa);
2. I’m mainly interested in the following groups of items:
2.1. “Archive stuff” (early / OG seasons): Margiela, Helmut Lang, Raf Simons (+Sterling Ruby and Twin peaks collections), Ann Demeulemeester, Rick Owens;
2.2. Niche / artisanal brands: Carol Christian Poell, Boris Bidjan Saberi, M.A+, Jan Jan Van Essche, Leon Emanuel Blanck, A1923;
2.3. High end: Louis Vuitton (Kim Jones period), Dior Homme, YSL, SLP, Berluti;
2.4. Japanese masters: Yohji Yamamoto (NOT Y-3), Number (N)ine (OG ONLY), Soloist, Undercover, Comme Des Garcons Homme Plus;
3. I am absolutely NOT interested in streetwear like Bape (unless it’s Bape x UC sneakers in my size), Supreme, Yeezy etc.
4. Trades can ONLY be done in 2 ways:
4.1. You send me items first, I receive them, I send the items to you;
4.2. You buy the items from me – I buy the items from you after that;
4.3. NO other options;
SHIPPING.
1. I ship from California USA
2. I always mark items as gift with 30$ value. If you have picky customs we can do a small real invoice for 30$ that you’ll pay from the money I gift back to you;
3. Delivery timing varies and delays sometimes happen, this is beyond my control. But generally Russian post is very good and reliable;
4. DHL etc are available if you pay their ridiculous rates (t-shirt – about 100$, jacket / shoes – 300-500$);
6. I do not hold any responsibility for any customs fees / formalities etc. I am ready to do whatever you ask to help you avoid it but if they charge you – I will not share this cost;
MISCELLANEOUS.
1. All is 100% authentic. I won’t bother looking for the receipts (even if I have them) – if you have doubts please don’t buy. My track record speaks for itself;
2. No returns, exchanges or refunds. Check the measurements, ask questions beforehand;
3. All the measurements are approximate (+/- 0.5 cm);
4. I DO NOT MAKE FIT PICS;
5. No offsite deals.

